import React, { useContext } from 'react';
import AppContext from '../../context/appContext';

const Perfil = () => {
	const user = useContext(AppContext);
	const { name } = user;

	return(
		<div>
			Bienvenido {console.log(user)}
		</div>
	)
}

export default Perfil;
